import React, { useEffect } from 'react';
import { useNavigate } from "react-router-dom"

export default function CheckLogin() {
	const Navigate = useNavigate()
	useEffect(
		() => {
			const token = localStorage.getItem('token');

			if (token === null) {
				history.push('/login');
			}
			else {
				history.push('/posts')
			}
		},
		[history]
	);
}
